import styled from 'styled-components'

export const PropertyHeaderWrapper = styled.header`
  display: flex;
  justify-content: space-between;
  border: 1px solid red;
`;

export const PropertyImageWrapper = styled.div`
border-radius: 20px;
img {
height: 100%;

}

`;
